import './App.css';
import { useState } from 'react';
import MusicUploadForm from './components/musicUploadForm/MusicUploadForm';
import HeaderList from './components/headerList/HeaderList';
import SongList from './components/songList/SongList';
import PlayJoinAll from './components/playJoinAll/PlayJoinAll';
import songs from './data/DataSong';


function App() {

  const [searchQuery, setSearchQuery] = useState('');
  const handleSearch = (query) => {
    setSearchQuery(query);
};

  return (
    <div className="App">
      <header className="App-header">
       <nav className='nav_'>
       <PlayJoinAll/>
       <MusicUploadForm onSearch={handleSearch}/>
       </nav>

      </header>
       <HeaderList/>
       <SongList songs={songs} searchQuery={searchQuery}/>

    </div>
  );
}

export default App;
